import logo from './logo.svg';
import './App.css';
import config from './config.js';


const google = window.google
//const config = require('/config.js');


let API_KEY = config["API_KEY"];
console.log(API_KEY);
console.log("hello");
let map;


function sendRequest() {
  const zipcode = document.getElementById("zipcode").value;

  const url = "https://maps.googleapis.com/maps/api/geocode/json?key=" + API_KEY + "&components=postal_code:" + zipcode

  fetch(url)
    .then(function (response) {
      return response.json();
    })
    .then(function (jsonResponse) {
      map.setCenter(jsonResponse.results[0].geometry.location)
    });
}

function initMap() {
  map = new google.maps.Map(document.getElementById("map"), {
    center: { lat: 47.606209, lng: -122.332069 },
    zoom: 13.25,
  });
}


function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
      <form> zip: <input type="text" name="zipcode" id="zipcode" value="" /> <a href="#" onClick={sendRequest()}>Go</a></form>

    </div>
  );
}

export default App;
